function App() {
  const [isOpen, setIsOpen] = useState(false)

  return (
    <>
    <div className="container">
      <div className="center">
        <div className="App">
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={hulk} className="App-logo" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={black} className="App-logo1" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={thor} className="App-logo2" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={wolverine} className="App-logo3" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={captain} className="App-logo4" alt="logo" width={100} height={100}/></button>
