            <button variant="primary" onClick={() => setIsOpen(true)}><img src={wonder} className="App-logo6" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={phoenix} className="App-logo7" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={goblin} className="App-logo8" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={doom} className="App-logo9" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={octopus} className="App-logo10" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={thanos} className="App-logo11" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}> <img src={ironman} className="App-logo12" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={galactus} className="App-logo13" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={magneto} className="App-logo14" alt="logo" width={100} height={100}/></button>
            <button variant="primary" onClick={() => setIsOpen(true)}><img src={loki} className="App-logo15" alt="logo" width={100} height={100}/></button>

        </div>
      </div>
    </div>

    </>
  );
}
